import React from 'react'
import Header from './Header';
import Menu from './Menu';
import {Route,Switch} from 'react-router-dom'

const App = () => {
    return (
        <>
            <Header />
            <Switch>
                <Route ecpath="/" component={Menu}/>
            </Switch>
        </>
    )
}

export default App;
